import React from 'react';
import ReactTable from 'react-table';
import { Link } from 'react-router-dom';
import 'react-table/react-table.css';

const userData = [
    {
        id:1,
        username:"user1",
        email:"email@email.com"
    },
    {
        id:2,
        username:"user2",
        email:"email@email.com"
    },
    {
        id:3,
        username:"user3",
        email:"email@email.com"
    },
    {
        id:4,
        username:"user4",
        email:"email@email.com"
    },
    {
        id:5,
        username:"user5",
        email:"email@email.com"
    },
    {
        id:6,
        username:"user6",
        email:"email@email.com"
    },
]

class TableData extends React.Component{
    constructor(props){
        super(props);
        this.data = userData;
        this.handleClick = this.handleClick.bind(this);
        this.tableColumns = [
            {
                Header:"S.no",
                accessor:"id"
            },
            {
                Header:"Username",
                accessor:"username"
            },
            {
                Header:"E-mail",
                accessor:"email"
            },
            {
                Header:"Manage",
                Cell: row => (
                    <button type="button" onClick={this.handleClick(row)} className="btn btn-green">Manage</button>
                )
            },
        ]

    }

    handleClick(){
        alert("hi")
    }
    render() {
        return (
            <div>
                <ReactTable filterable data={this.data} columns={this.tableColumns} defaultPageSize={10} className="-highlight" />
            </div>
        )
    }

}
export default TableData;
